def get(iscramble, index):
    # Get scrambler
    scramble = scrambler[iscramble]
    
    # Index length of scrambler
    index = index % len(scramble) 
    index = scramble[index] 
    index = index % len(raw_segments)
    
    # Get and return segment
    raw_segment = raw_segments[index]    
    return raw_segment


if __name__ == '__main__':
    '''
    Builds a new scramber list 
    '''
    import random
    
    # Generate multiple sets
    for i in xrange(0, 390):
        # Generate a list for random pick without re-placement
        values = range(0, len(raw_segments))
        items = []
        while len(values) > 0: 
            pick = random.randint(0, len(values) - 1)
            item = values[pick]
            del values[pick]
            items.append('%i' % item)
        line = ', '.join(items)
        line = 'scrambler.append([' + line + '])'
        print(line)
